import styled from "styled-components";
import { styles } from "ansi-colors";

export const ShoppingSiteContainer = styled.div`
  padding-top: 50px;
  display: flex;
`;

export const FiltersSidebar = styled.div`
  width: 15%;
  padding-right: 5px;
`;

export const SizesHeading = styles.h3`
padding-left: 40px;
`;

export const MainContentContainer = styles.div`
width: 85%;
`;
